xplicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:20903:"<p><em><a href="http://mainelearning.net"><img class="alignright  wp-image-22643 no-shadow" alt="MLN badge" src="http://jaycollier.net/files/2013/01/mln-badge-2013-01-29c-300x300.png" width="175" height="175" /></a>This post is by <a href="http://jaycollier.net">Jay Collier</a> of The Compass LLC. Jay has been a consultant to the Maine Department of Education for the past 2 years, during which time, he proposed, built, and is continuously improving <a href="http://MaineLearning.net">MaineLearning.net</a>, a professional collaboration community and learning resource directory for Maine educators.</em></p>\n<p><em>MaineLearning.net is built on WordPress and BuddyPress, using a highly-curated set of plugins and themes. In the following report, Jay outlines Maine’s use of BuddyPress as part of its continuing innovations in K-12 education.</em><span id="more-22586"></span></p>\n<h2>Strategic context</h2>\n<p>The <a href="http://maine.gov/">state of Maine</a> has been an innovator in <a href="http://www.maine.gov/mlti/index.shtml">digital learning</a> for over 15 years.</p>\n<ul>\n<li>The <a href="http://www.msln.net/">Maine School and Library&nbsp;Network</a>, initiated in 1996, provides Internet access to all&nbsp;schools and libraries&nbsp;in Maine.</li>\n<li>The&nbsp;<a href="http://www.maine.gov/mlte/">one-to-one laptop program</a>, established by law in 2001, provides laptops to every 7th and 8th grader in the state, while school districts fund laptops for an additional 50% of high school students.</li>\n<li>A high-speed <a href="http://www.mainefiberco.com/">network backbone</a>, bringing gigabit ethernet to rural communities, was completed in 2012. The goal was to provide inexpensive connectivity to last-mile providers: for-profit corporations, not-for-profit organizations, cooperatives, and municipalities.</li>\n<li>In 2012, Maine passed legislation for <a href="http://www.pressherald.com/news/maine-switchdiploma-based-on-proficiency_2012-04-10.html">proficiency-based high school diplomas</a>. Starting in 2017, rather than receiving passing grades in a standardized series of courses in order to graduate, many high school&nbsp;students will be able to receive a diploma by demonstrating proficiency in a variety of ways, from traditional tests to portfolios, performance, exhibitions and projects … and at their own pace. Schools will be allowed to eliminate age-based classes altogether.</li>\n<li><a href="http://www.slideshare.net/collier/innovations-in-maine-education">And more</a>.</li>\n</ul>\n<h2>Online community of practice</h2>\n<p>To support this transition to learner-centered and proficiency-based learning, commissioner&nbsp;<a href="http://www.maine.gov/education/commissioner">Stephen Bowen</a>&nbsp;charged the Department of Education with developing an&nbsp;<a href="http://jaycollier.net/strategy/collaboration/discovery/">online community of practice</a>&nbsp;(OCOP) “where teachers, school leaders, curriculum coordinators and others can share best practices – lesson plans, rubrics, curriculum materials and professional development opportunities.” The charge:</p>\n<ul>\n<li>\n<p lang="en-US">Build a professional learning community platform to help educators engage in conversation, share innovative ideas, discover and curate useful resources, document successful practices, and apply them in their own classrooms and schools.</p>\n</li>\n<li>\n<p lang="en-US">Support and sustain continuity between in-person meetings and professional development opportunities. Help new constituents get up to speed and become valuable, active partners in learning communities.</p>\n</li>\n<li>\n<p lang="en-US">Model an interdisciplinary, continuous-learning community approach that can be implemented at schools and districts across the state.</p>\n</li>\n<li>\n<p lang="en-US">Connect teachers, administrators, parents, and taxpayers so they can discuss important educational policy issues.</p>\n</li>\n</ul>\n<p>So, in the summer of 2011, we <a href="http://jaycollier.net/strategy/collaboration/discovery/">developed a digital strategy</a>, <a href="http://jaycollier.net/strategy/collaboration/creating-learnmaine/">built a demonstration site</a>&nbsp;in less than a month&nbsp;and&nbsp;drafted <a href="http://mainelearning.net/about/user-generated-content-policy/">policies for user-generated content</a>. Initial funding was earmarked in November 2011, the initiative was&nbsp;integrated into the Department’s&nbsp;<a href="http://www.maine.gov/doe/plan/index.html">strategic plan</a>&nbsp;in January 2012, and&nbsp;the version 2.0&nbsp;<a href="http://mainelearning.net">production site</a> went live in February 2012. During the following months, the Department approved 21 practice groups&nbsp;with 250 active members.</p>\n<h2>Architecting engagement</h2>\n<p><a href="http://jaycollier.net/files/2013/01/ocp-engagement.png" class="fancybox" rel="gallery-0"><img class="alignright size-medium wp-image-22496 no-border" title="ocp-engagement" alt="" src="http://jaycollier.net/files/2013/01/ocp-engagement-300x236.png" width="300" height="236" /></a></p>\n<p>From day one, we wanted the platform to support increasing levels of engagement, from initial observations (“lurking,” in the positive sense) all the way through to moderating and leading practice teams.</p>\n<p>Although the OCOP would be launched quietly and was limited to Department-approved practice groups and members during 2012, from the start all group conversations were intended to be visible to the world: a virtual version of the <a href="http://en.wikipedia.org/wiki/Fishbowl_(conversation)">fishbowl model</a>&nbsp;of collaboration.</p>\n<p>We wanted members to be able to receive activity notifications immediately or via daily or weekly digests. We wanted visitors to be able to&nbsp;<a href="http://mainelearning.net/about/">follow any group</a>&nbsp;by subscribing to its feed via the Blogtrottr service.</p>\n<p>Then, after implementing the collaboration features, the next phase would be a&nbsp;<a href="http://mainelearning.net/resources/">learning resources directory</a>, which would contain recommendations (via URL) for:</p>\n<ul>\n<li>Digital learning&nbsp;<strong>objects</strong>, such as content, multimedia, applications, lesson plans, and syllabi that can be used anytime, on any device, in any setting, at home and in classrooms, and through self-directed study and professional development initiatives, and</li>\n<li>Digital learning&nbsp;<strong>opportunities</strong>, including classes, courses, workshops and professional development sessions and that provide live interaction between, and among, students and teachers, learning coaches and community mentors</li>\n</ul>\n<p>Whereas there already countless global resource repositories — containing both free and “premium” objects — when we began, there were no registries that organized links to resources based on Maine-specific needs and standards, and no single repository contained links to local Maine learning resources: expanded learning opportunities, service-learning projects, and community mentoring opportunities. Our Resource Directory was created to do just that.</p>\n<h2>Laying the foundations</h2>\n<p>From the start, our goal was to deliver a&nbsp;<a href="http://en.wikipedia.org/wiki/Minimum_viable_product">minimal viable product</a>&nbsp;to demonstrate potential, and then to rapidly iterate while adding functions requested by our early users. Our first step was to identify the platform that could be quickly configured to support familiar kinds of online collaboration — forums, document sharing, wiki pages, blog posts, and status updates — while being able to support our vision of the ideal future platform.</p>\n<p>So, we pulled together all of the requests we’d received from DOE staff and constituents (including features from a series of previous projects) and created a detailed&nbsp;<a href="https://docs.google.com/spreadsheet/ccc?key=0AnN5FWMlt7YEdENCalRRdExFU3RfSkE1X0J3dUhhQWc">list of criteria</a>, for which we made an initial evaluation using the&nbsp;<a href="http://en.wikipedia.org/wiki/Nominal_group_technique">NGT</a>&nbsp;ranking technique. (See tabs along the bottom of the&nbsp;<a href="https://docs.google.com/spreadsheet/ccc?key=0AnN5FWMlt7YEdENCalRRdExFU3RfSkE1X0J3dUhhQWc">spreadsheet</a>&nbsp;for details.)</p>\n<p>Since we knew we wanted to create a framework that could be&nbsp;easily replicated by school districts and other learning organizations and jurisdictions, and&nbsp;at low cost,&nbsp;we started with the open-source frameworks supported by our state’s IT office: Drupal and&nbsp;WordPress. We determined that both platforms were viable, and chose WordPress because it could be easily configured by non-technologists. The BuddyPress environment was critical to meeting our defined criteria.</p>\n<h2>Building on WordPress and BuddyPress</h2>\n<p>We started with minimal resources — 40% of my time, external hosting services, and about 40 hours for back-end administration and quality control for plugin code for the first 9 months. We contracted with SiteGround for&nbsp;<a href="http://www.siteground.com/vps_hosting.htm">cloud VPS hosting</a>&nbsp;and with BuddyPress developer&nbsp;<a href="http://buddypress.org/community/members/boonebgorges/profile/">Boone Gorges</a>&nbsp;for back-end support. Boone set up a public&nbsp;<a href="https://github.com/MaineLearning/MaineLearning">GitHub repository</a>&nbsp;and&nbsp;configured our server for the Git development workflow. I installed&nbsp;<a href="http://www.mamp.info/en/">MAMP</a>,&nbsp;<a href="http://code.google.com/p/gmask/">Gas Mask</a>, and&nbsp;<a href="http://mac.github.com/">GitHub for Mac</a>&nbsp;on my own machine for local development.</p>\n<p>Since I am a strategist (rather than a back-end developer), I found it quite easy to implement desired features by finding and evaluating WordPress plugins, installing, activating, and testing them on my local machine, and, if acceptable, pushing them to the current development branch at GitHub, all without needing coding experience. When needed, I asked Boone to provide recommendations, check for PHP errors, and add site-specific code to meet our needs. He would then push to production.</p>\n<h3>Configuration and theming</h3>\n<p>To get started, I installed WordPress multisite (using subdirectories rather than subdomains) and installed BuddyPress on the main site. I chose to use the BuddyPress default theme for the main site and the Genesis framework for subsites; all customizations were to child themes. I made continuous interface tweaks via the Custom CSS plugin, and for each periodic push from development to production, I moved those changes into each theme’s styles.css file for versioning.</p>\n<h3>Plugins</h3>\n<p>Here are some of the key plugins we’re currently using with WP 3.4 and BP 1.6. Most of these are perennials that have been maintained through many core software updates, and across multiple projects.</p>\n<h4>Administration</h4>\n<ul>\n<li>Allow Multiple Accounts</li>\n<li>Gravity Forms (premium)</li>\n<li>Gravity Forms + Custom Post Types</li>\n<li>Network Privacy</li>\n<li>TurboCSV (premium)</li>\n<li>Types and&nbsp;WP-Views (now WP-Toolset, premium)</li>\n<li>User Switching</li>\n<li>WP Optimize</li>\n<li>WP Super Cache</li>\n</ul>\n<h4>Authoring and back-end</h4>\n<ul>\n<li>Admin Menu Editor</li>\n<li>Broken Link Checker</li>\n<li>Enable Media Replace</li>\n<li>Events Manager</li>\n<li>Post Type Switcher</li>\n<li>Resize at Upload</li>\n<li>TinyMCE Advanced</li>\n</ul>\n<h4>BuddyPress</h4>\n<div>\n<ul>\n<li>BuddyPress</li>\n<li>BP Group Documents</li>\n<li>BP Group Management</li>\n<li>BP Group Organizer</li>\n<li>BuddyPress Docs</li>\n<li>BuddyPress Edit Group Slug</li>\n<li>BuddyPress Group Email</li>\n<li>BuddyPress Moderation</li>\n<li>Invite Anyone</li>\n</ul>\n<h4>Integration with external services</h4>\n<div>\n<ul>\n<li>Akismet</li>\n<li>Learning Registry Display Widget</li>\n</ul>\n<h4>Interface and navigation</h4>\n<ul>\n<li>Autolink URI</li>\n<li>CryptX</li>\n<li>Custom CSS Manager (moving into Jet Pack)</li>\n<li>External Links</li>\n<li>Hide Broken Shortcodes</li>\n<li>No Page Comment</li>\n<li>Query Multiple Taxonomies</li>\n<li>Theme Test Drive</li>\n<li>WP Page-Navi</li>\n</ul>\n</div>\n</div>\n<p>Of course, our use of these plugins is always provisional; I continue to evaluate alternatives that will meet our requirements even better. Indeed, we are already in the process of replacing some of these plugins with alternatives.</p>\n<h3>Customization</h3>\n<p>We added a number of code snippets to the functions file for minor customizations:</p>\n<ul>\n<li>We added navigation buttons to activity stream items</li>\n<li>We changed the default member avatar</li>\n<li>We loaded common site-specific CSS styles into TinyMCE drop-down menus</li>\n<li>We adapted&nbsp;<a href="http://helen.wordpress.com/2012/01/08/using-chosen-for-a-replacement-taxonomy-metabox/">Helen Hou’s implementation</a>&nbsp;of the Chosen multi-select list styling to simplify back-end metaboxes for multiple taxonomies</li>\n</ul>\n<h3>A note on custom content&nbsp;types, fields, and taxonomies</h3>\n<p>For the Learning Resources Directory, I needed to create and maintain&nbsp;custom post types, field groups, and taxonomies to support a rather complex data structure for metadata for our learning standards: the&nbsp;<a href="http://www.maine.gov/education/lres/pei/index.html">Maine Learning Results</a>&nbsp;and&nbsp;<a href="http://www.corestandards.org/the-standards">Common Core State Standards</a>.</p>\n<p>After having tried nearly every plugin option (and combination), I settled on&nbsp;<a href="http://wp-types.com/">WP Types &amp; Views</a>&nbsp;(now called WP-Toolset), which allowed me to rapidly prototype and improve data structures. Then, I used&nbsp;<a href="http://www.gravityforms.com/">Gravity Forms</a>&nbsp;to create&nbsp;<a href="http://mainelearning.net/resources/recommend/">front-end forms</a>&nbsp;to prompt educators to organize and classify their recommended resources.</p>\n<p>This work has only just begun, but WP-Toolset has provided all the features we’ve needed; indeed it can be compared favorably with the Blocks, Views, Panes, and Panels modules and functions for Drupal. Indeed, I’ll be experimenting with WP-Toolset’s&nbsp;<a href="http://wp-types.com/home/cred/">CRED feature</a> to more easily integration between front-end forms and structured data.</p>\n<h2>Today</h2>\n<p>The&nbsp;<a href="http://mainelearning.net/">online community of practice</a>&nbsp;has now been fully-functional since March, 2012. Since then,&nbsp;the Department has approved 21 practice groups&nbsp;with 250 members; the more active groups have included: the&nbsp;<a href="http://mainelearning.net/groups/dlag/">Digital Learning Advisory Group</a>, the&nbsp;<a href="http://mainelearning.net/groups/cdln/">Cross Discipline Literacy Network</a>&nbsp;(and its 10 subgroups), the&nbsp;<a href="http://mainelearning.net/groups/arts-leaders/">Maine Arts Education Leaders</a>&nbsp;cohort, and the&nbsp;<a href="http://mainelearning.net/groups/dcs/">Digital Citizenship in Schools</a>&nbsp;discussion group. We recently added a space for service-learning coordinators and practitioners, and maintain a list of group and membership requests.</p>\n<p>The&nbsp;<a href="http://mainelearning.net/resources">learning resources directory</a>&nbsp;has been tested by a variety of educators, with continuous improvements based on user feedback. The Arts Education cohort is developing a peer review process for those who ask for review of their submissions. Wikipedia-style ratings will be implemented next.</p>\n<p>Currently, program direction, platform administration, and community stewardship functions are being performed by myself (Jay Collier) and our back-end developer, Boone Gorges (core software developer for the collaboration software).</p>\n<h2>Next phase</h2>\n<p>We’ve now been live for almost one year. As we approach the end of our current funding and contract cycles, the state of Maine has been working to sustain MaineLearning.net.</p>\n<ul>\n<li>The Department of Education has been planning to initiate a public communications campaign and is seeking funding to fund program leadership and community stewardship through the next level of service, including those potential enhancements listed below.</li>\n<li>The state’s Office of Information Technology has been developing an RFP that will seek external vendors to provide&nbsp;Internet hosting, software management, and back-end development to support the continuous improvement of the platform when the current funding and contracts end this spring.</li>\n</ul>\n<p>With sufficient resources, we are considering many potential enhancements, including the following, all of which are possible within the current framework, given additional staffing:</p>\n<h4>Potential collaboration enhancements</h4>\n<ul>\n<li>Allowing open group applications and selecting new groups based upon capacity</li>\n<li>Professional development support, including organic groups for sustained collaboration between webinars, seminars, and workshops</li>\n<li>Active management of resource vetting teams, including rubric development, and credential design (badges)</li>\n<li>Availability of sub-sites (blogs) for every group, upon request</li>\n</ul>\n<h4>Potential resource directory enhancements</h4>\n<ul>\n<li>Statewide promotion for crowdsourced resource sharing</li>\n<li>Simplified resource submission interfaces and predefined search results</li>\n<li>Multiple levels of evaluation options, from thumbs up/down, to multi-question reviews, to peer review workflows</li>\n<li>Exchange of vetting data (paradata) via US DOE Learning Registry and other repositories</li>\n<li>Ingest of pre-existing learning resources, from vetted OERs to professional development objects, to community learning opportunities</li>\n</ul>\n<h4>Potential administrative initiatives</h4>\n<ul>\n<li>Grant applications for funding from regional and national foundations</li>\n<li>Consulting with other jurisdictions that wish to replicate the model</li>\n<li>Contributing lessons learned and custom add-ons back to the open-source community</li>\n<li>Investigating viability of integrating ePortfolio and learning management (ScholarPress) features into the platform</li>\n</ul>\n<h2>Toward the future of learning</h2>\n<p>In <a href="http://www.maine.gov/doe/plan/index.html"><em>Education Evolving</em> </a>(<a href="http://www.maine.gov/doe/plan/strategic_plan_web_final.pdf">PDF</a>) — Maine’s 2012 strategic plan for learning in Maine — Commissioner Bowen worked with educators around the state to define the challenges and opportunities of 21st-century education.</p>\n<blockquote><p>To build on the great work being done in Maine’s schools today, and to move from a century-old model of schooling to a more effective, learner-centered approach in the process, will require a steady focus on a handful of core priorities organized around meeting the individual learning needs of all students …</p>\n<p>Such a move won’t take place through the imposition of heavy-handed mandates or one-size-fits-all approaches from Augusta, but by building on the innovative work being done in schools across Maine already and by employing strategies to increase collaboration and sharing of best practices….</p>\n<p>As Harvard’s Tony Wagner argues in his book <em>The Global Achievement Gap</em>, teaching has been and continues to be a largely solitary practice providing few opportunities for collaboration and sharing of best practices…</p>\n<p>With the advent of &nbsp;the Internet, the sharing of new ideas and new approaches to teaching can be far more readily facilitated. Instructional materials, research on best practices, and even videos of effective instructional methods can be shared instantly across the state and around the world.</p>\n</blockquote>\n<p>Collaborative, learner-centered education is at the heart of Maine’s strategy for transforming learning communities for this new era and <a href="http://MaineLearning.net">MaineLearning.net</a>&nbsp;supports that strategy.</p>\n<p><em>Watch an introduction to Innovations in Maine Learning, including the MaineLearning.net online community of practice and learning resources directory: <a href="http://www.slideshare.net/collier/innovations-in-maine-education">http://www.slideshare.net/collier/innovations-in-maine-education</a></em></p>\n</p>\n<p><em>This case study was supported by the <a href="http://maine.gov/doe/">Maine Department of Education</a>. An earlier version was partially funded by the British Columbia <a href="http://www.bcerac.ca/">Educational Resources Acquisition Consortium</a>.</em></p>\n<div class="share_buttons_simple_use_buttons">\n<div class="tweet_button"></div>\n<div class="facebook_like_button"></div>\n</div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 30 Jan 2013 20:38:34 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Boone Gorges";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: WordPress Theme Releases for 1/30";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12601";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/RFlfXBzTs90/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1356:"<p><a href="http://wordpress.org/extend/themes/appliance"><img class="alignnone size-thumbnail wp-image-12602" alt="screenshot" src="http://i2.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot7.png?resize=150%2C150" /></a></p>\n<p><a href="http://wordpress.org/extend/themes/appliance"><strong>Appliance</strong></a> is a clean and minimalist theme.</p>\n<p><a href="http://wordpress.org/extend/themes/childishly-simple"><img class="alignnone size-thumbnail wp-image-12603" alt="screenshot-1" src="http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-16.png?resize=150%2C150" /></a></p>\n<p><a href="http://wordpress.org/extend/themes/childishly-simple"><strong>Childishly Simple</strong></a> is a multiple-layout theme with a variety of theme options.</p>\n<p><a href="http://emptynestthemes.com/2013/01/29/lush-wordpress-theme/"><img class="alignnone size-thumbnail wp-image-12604" alt="DemoBlog" src="http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/DemoBlog3.png?resize=150%2C150" /></a></p>\n<p><a href="http://emptynestthemes.com/2013/01/29/lush-wordpress-theme/"><strong>Lush</strong></a> is a bright, cheerful, and definitely colorful responsive theme using Google fonts.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/RFlfXBzTs90" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 30 Jan 2013 19:05:27 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:30:"Matt: Neil Leifer on WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=42116";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:46:"http://ma.tt/2013/01/neil-leifer-on-wordpress/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3430:"<p>One of my favorite photographers, <a href="http://neilleifer.com/">Neil Leifer, has a beautiful new WordPress.com-powered site</a>. For the past few years I&#8217;ve had this photo in my office:</p>\n<p><a href="http://s.ma.tt/files/2013/01/ali-williams.jpg"><img class="alignnone size-large wp-image-42117" alt="Ali - Williams (Overhead)" src="http://i2.wp.com/s.ma.tt/files/2013/01/ali-williams.jpg?resize=640%2C648" /></a></p>\n<p>The story behind it is pretty interesting, taken from <a href="http://bermangraphics.com/press/leifer.htm">this interview with Larry Berman and Chris Maher</a>:</p>\n<div class="blockquote">\n<blockquote><b>Chris/Larry: </b>It&#8217;s actually quite a different question to say what are your favorites verses what do you feel are your best photographs.</p>\n<p><b>Neil:</b> I know, and my best picture ever, in my opinion, is my Ali Cleveland Williams picture that I shot from overhead. I don’t usually hang my own photos, I collect other people’s pictures. But that picture’s been hanging in my living room as long as I can remember. I have a 40&#215;40 print of it which is hung in a diamond shape with Williams at the top. That&#8217;s the guy that’s on the canvas on his back.</p>\n<p><b>Chris/Larry:</b> It’s remarkably abstract for a sports picture.</p>\n<p><b>Neil:</b> I think it’s the only picture in my career that there’s nothing I would do different with it. You look at pictures and think that you can always improve them no matter how successful the shoot is. Part of what motivates you to go on to the next shoot is every once in a while you get a picture, whether it&#8217;s the cover of the magazine or an inside spread, that&#8217;s as good as you think you could have made it. And then a week later you see a couple of things that you could improve slightly. A month later you might see a few more things. It doesn’t diminish the quality of that picture. It simply means that there&#8217;s always room for improvement.</p>\n<p><b>Chris/Larry:</b> You’re learning for the future?</p>\n<p><b>Neil:</b> Exactly. It’s sort of what motivates you to go on. If I were to do the Cleveland Williams Ali picture again, I would do it exactly the same. And more important is that no one will ever do it better because it can’t be done like that anymore. Today the ring is different and the fighters dress in multi colored outfits like wrestlers. Back then the champ wore white and the challenger wore black.  Today, when you look down at the ring from above, you see the Budweiser Beer logo in the center and around it is the network logo that’s televising the fight. Whether it’s Showtime or HBO, they have their logo two or three times on the canvas. The logo of promoter of the fight, Don King Presents, is also visible. That&#8217;s why that picture couldn&#8217;t be taken today. So not only did the picture work out better than any I’ve ever taken, but it’s one that’ll never be taken again.</p>\n<p><img alt="©Neil Leifer" src="http://i0.wp.com/bermangraphics.com/images/Neil-Ali_Williams-p143.jpg?resize=300%2C265" border="0" /></p>\n<p><b>Chris/Larry:</b> Where are you in this picture?</p>\n<p><b>Neil:</b> I’m at 11:00 o’clock, as I remember it. I’m in a blue shirt leaning on the canvas with a camera in each hand.</p></blockquote>\n</div>\n<p>It&#8217;s always an honor to have a great creator make their home on the web with WordPress.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 29 Jan 2013 11:22:37 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:27:"bbPress: bbPress 2.3 Beta 1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://bbpress.org/?p=125680";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://bbpress.org/blog/2013/01/bbpress-2-3-beta-1/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1186:"<p>Today we tagged bbPress 2.3 beta 1 in the WordPress.org plugin repository. This means we think 2.3 ready to release into the wild, but want to get a few extra eyes on things first. It represents the 4th major iteration of bbPress as a plugin for your self-hosted WordPress powered website, and we&#8217;re excited about how far we&#8217;ve come.</p>\n<p>Even though bbPress 2.3 is developer tested, we don’t recommend you run it on a production site quite yet. Instead, set up a test site or a local installation to play with. If you find a bug, patch it or let us know.</p>\n<p>We are aiming to release bbPress 2.3 in the first week of February. Now&#8217;s the time to <a href="http://codex.wordpress.org/Reporting_Bugs">report some feedback</a>!</p>\n<p>If you think you found a bug, please report it on the <a href="http://bbpress.trac.wordpress.org">bbPress Core Trac</a>. If you find a security vulnerability, please be discrete and let us know privately using one of the methods posted on the <a href="http://wordpress.org/about/contact/">WordPress contact page</a>.</p>\n<p><a href="http://downloads.wordpress.org/plugin/bbpress.zip">Download bbPress 2.3, Beta 1 ↓</a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 28 Jan 2013 20:18:38 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"John James Jacoby";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 1/28";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12589";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/S8WZArn7jUk/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1180:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/cross-promotion-content-recommendations/"><strong>Cross-Promotion Content Recommendations</strong></a> drives a fresh new audience to your site by cross-promoting your posts with other related bloggers.</p>\n<p><a href="http://wordpress.org/extend/plugins/upload-photo-to-facebook/"><strong>Upload Photo to Facebook</strong></a> uploads photos to your Facebook profile.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://calendarscripts.info/autoresponder-wordpress.html"><strong>BFT Autoresponder</strong></a> allows scheduling of automated autoresponder messages and managing a mailing list.</p>\n<p><a href="http://wordpress.org/extend/plugins/hyperdb/"><strong>HyperDB</strong></a> is an advanced database class that supports replication, failover, load balancing, and partitioning.</p>\n<p><a href="http://wordpress.org/extend/plugins/wpmarketplace/"><strong>WP Marketplace</strong></a> is a full-featured shopping cart/e-commerce system that is extremely easy to install and even easier to maintain.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/S8WZArn7jUk" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 28 Jan 2013 14:00:55 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: WordPress Theme Releases for 1/26";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12582";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/khedzDlh4gk/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1449:"<p><a href="http://wordpress.org/extend/themes/classic-chalkboard"><img class="alignnone size-thumbnail wp-image-12583" alt="screenshot" src="http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot6.png?resize=150%2C150" /></a></p>\n<p><a href="http://wordpress.org/extend/themes/classic-chalkboard"><strong>Classic ChalkBoard</strong></a> is a whimsical theme emulating a classic school chalkboard, complete with a bottom-resting eraser and chalk.</p>\n<p><a href="http://www.themelab.com/2013/01/24/icechimp-free-wordpress-theme/"><img class="alignnone size-thumbnail wp-image-12585" alt="screenshot-1" src="http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-15.png?resize=150%2C150" /></a></p>\n<p><a href="http://www.themelab.com/2013/01/24/icechimp-free-wordpress-theme/"><strong>IceChimp</strong></a> is a free &#8220;coming soon&#8221; theme.</p>\n<p><a href="http://emptynestthemes.com/2013/01/25/sleek-wordpress-responsive-theme/"><img class="alignnone size-thumbnail wp-image-12584" alt="DemoBlog" src="http://i2.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/DemoBlog2.png?resize=150%2C150" /></a></p>\n<p><a href="http://emptynestthemes.com/2013/01/25/sleek-wordpress-responsive-theme/"><strong>Sleek</strong></a> is an attractive, clean, and professional theme.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/khedzDlh4gk" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 26 Jan 2013 14:00:03 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:44:"Mike Little: WordPress – A 10 year journey";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://zed1.com/journalized/?p=1867";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:147:"http://zed1.com/journalized/archives/2013/01/25/wordpress-a-10-year-journey/?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-a-10-year-journey";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2500:"<p><a href="http://zed1.com/journalized/wp-content/uploads/2013/01/wordpress-logo-notext-rgb.png"><img class="size-thumbnail wp-image-1873 alignleft" alt="WordPress logo" src="http://zed1.com/journalized/wp-content/uploads/2013/01/wordpress-logo-notext-rgb-150x150.png" width="150" height="150" /></a></p>\n<p>I find it hard to believe but it has now been <strong>ten years</strong> since my fateful <a href="http://ma.tt/2003/01/the-blogging-software-dilemma/#comment-445">comment on Matt&#8217;s blog </a>that kicked off what became the <a href="http://wordpress.org/">WordPress</a> project!<br />\nFrom those humble beginnings of a simple unmaintained blogging platform (b2/Cafelog) to a world-beating open source CMS. B2/Cafelog was used by perhaps 2,000 bloggers. Now WordPress runs more than <a href="http://en.wordpress.com/stats/">60 million sites</a> around the world. That&#8217;s over <a href="http://w3techs.com/technologies/overview/content_management/all">17.5% of the web</a>!</p>\n<h2>WordPress Industry</h2>\n<p>WordPress now supports a world-wide industry from individual <a href="http://mikelittle.org/">WordPress specialists</a> like me (I&#8217;ve just completed my fourth year as my own company <a href="http://zed1.com/">zed1.com</a>); small WordPress-based companies like <a href="http://codeforthepeople.com/">Code for the People</a>; through to multi-million dollar companies like <a href="http://www.copyblogger.com/">Copyblogger</a>, <a href="http://www.woothemes.com/">WooThemes</a>, and of course <a href="http://automattic.com/">Automattic</a>.</p>\n<p>Praise must go as usual to the <a href="http://make.wordpress.org/">fantastic community</a> around WordPress, the singular vision of <a href="http://ma.tt/">Matt Mullenweg</a>, and the awesome power of the <a title="GNU General Public License" href="http://www.gnu.org/licenses/gpl.html">GNU GPL</a> open source license.</p>\n<h2>Here&#8217;s to the next year</h2>\n<p>As WordPress enters it&#8217;s <strong>eleventh</strong> year, with version 3.5.1 recently released and <a href="http://make.wordpress.org/core/">version 3.6 currently in the making</a>, I predict it will be another great year for <a title="Personal Publishing Platform" href="http://wordpress.org">WordPress</a>.</p>\n<p>The post <a href="http://zed1.com/journalized/archives/2013/01/25/wordpress-a-10-year-journey/">WordPress &#8211; A 10 year journey</a> appeared first on <a href="http://zed1.com/journalized">Mike Little&#039;s Journalized</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 25 Jan 2013 10:49:04 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:11:"Mike Little";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:49:"Weblog Tools Collection: WordPress 3.5.1 Released";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12577";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/UVRBgAFV70k/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1397:"<p><a href="http://wordpress.org">WordPress</a> 3.5.1 <a href="http://wordpress.org/news/2013/01/wordpress-3-5-1/">has been released</a>. This is both a security and maintenance release, fixing <a href="http://core.trac.wordpress.org/query?milestone=3.5.1">37 bugs</a>.</p>\n<p>In particular, this release fixes a bug which could cause HTML elements to be unexpectedly removed by the Editor, fixes a bug which caused HTML elements to be unexpectedly removed from scheduled posts, provides workarounds for certain misconfigurations which could prevent JavaScript from loading in the Dashboard, and fixes three cross-site scripting vulnerabilities and one server-side request forgery vulnerability.</p>\n<p>If you have trouble automatically updating to WordPress 3.5.1, you may be on an IIS server and will need to follow <a href="http://codex.wordpress.org/Version_3.5.1#Windows_Servers_Running_IIS">these instructions</a>.</p>\n<p>This is a security release, so it is recommended for all users. If you run into trouble with WordPress 3.5.1, stop by <a href="http://wordpress.org/support/topic/troubleshooting-wordpress-35-master-list">the master list of known issues</a> and post to <a href="http://wordpress.org/support/">the support forums</a> if your problem isn&#8217;t covered there.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/UVRBgAFV70k" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 25 Jan 2013 04:15:08 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Dev Blog: WordPress 3.5.1 Maintenance and Security Release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:33:"http://wordpress.org/news/?p=2531";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:50:"http://wordpress.org/news/2013/01/wordpress-3-5-1/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2494:"<p>WordPress 3.5.1 is now available. Version 3.5.1 is the first maintenance release of 3.5, <a href="http://core.trac.wordpress.org/milestone/3.5.1">fixing 37 bugs</a>. It is also a security release for all previous WordPress versions. For a full list of changes, consult the <a href="http://core.trac.wordpress.org/query?milestone=3.5.1">list of tickets</a> and the <a href="http://core.trac.wordpress.org/log/branches/3.5?rev=23341&stop_rev=23167">changelog</a>, which include:</p>\n<ul>\n<li>Editor: Prevent certain HTML elements from being unexpectedly removed or modified in rare cases.</li>\n<li>Media: Fix a collection of minor workflow and compatibility issues in the new media manager.</li>\n<li>Networks: Suggest proper rewrite rules when creating a new network.</li>\n<li>Prevent scheduled posts from being stripped of certain HTML, such as video embeds, when they are published.</li>\n<li>Work around some misconfigurations that may have caused some JavaScript in the WordPress admin area to fail.</li>\n<li>Suppress some warnings that could occur when a plugin misused the database or user APIs.</li>\n</ul>\n<p>Additionally, a bug affecting Windows servers running IIS can prevent updating from 3.5 to 3.5.1. If you receive the error &#8220;Destination directory for file streaming does not exist or is not writable,&#8221; you will need to <a href="http://codex.wordpress.org/Version_3.5.1">follow the steps outlined on the Codex</a>.</p>\n<p>WordPress 3.5.1 also addresses the following security issues:</p>\n<ul>\n<li>A server-side request forgery vulnerability and remote port scanning using pingbacks. This vulnerability, which could potentially be used to expose information and compromise a site, affects all previous WordPress versions. This was fixed by the WordPress security team. We&#8217;d like to thank security researchers <a href="http://codeseekah.com/">Gennady Kovshenin</a> and <a href="http://www.ethicalhack3r.co.uk/">Ryan Dewhurst</a> for reviewing our work.</li>\n<li>Two instances of cross-site scripting via shortcodes and post content. These issues were discovered by Jon Cave of the WordPress security team.</li>\n<li>A cross-site scripting vulnerability in the external library Plupload. Thanks to the Moxiecode team for working with us on this, and for releasing Plupload 1.5.5 to address this issue.</li>\n</ul>\n<p><strong><a href="http://wordpress.org/download/">Download 3.5.1</a> or visit Dashboard → Updates in your site admin to update now.</strong></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 22:23:03 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Andrew Nacin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:61:"BuddyPress: BuddyPress 1.6.4 Maintenance and Security Release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://buddypress.org/?p=151669";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:80:"http://buddypress.org/2013/01/buddypress-1-6-4-maintenance-and-security-release/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:615:"<p><a href="http://wordpress.org/extend/plugins/buddypress/">BuddyPress 1.6.4</a> (now available for download) is a maintenance and security release, and a safe and easy update for all previous BuddyPress versions.</p>\n<p>Version <a href="http://wordpress.org/extend/plugins/buddypress/">1.6.4</a> includes some security hardening inside the bp-default theme&#8217;s ajax functionality. These issues were responsibly disclosed by Maty Siman.</p>\n<p><strong><a href="http://wordpress.org/extend/plugins/buddypress/">Download 1.6.4</a> now or visit Dashboard → Updates in your site admin to update now.</strong></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 22:10:55 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"John James Jacoby";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:10;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:68:"Ping-O-Matic: Engage: Make Your Online Home a Place for Conversation";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:32:"http://blog.pingomatic.com/?p=77";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:49:"http://blog.pingomatic.com/2013/01/24/engagement/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2763:"<p><a href="http://pingomatic.com/">Ping-O-Matic</a> is all about getting your latest content out into the world and driving more traffic to your blog. And if you have a blog, chances are you want to be part of a larger community. You don&#8217;t just want to create and share your stuff &#8212; you want to connect with people who share your interests and passions in a meaningful way.</p>\n<p>Publishing a post is just one step in blogging &#8212; getting people to engage with you is another. How do you start a conversation?</p>\n<h3>Here are some tips:</h3>\n<ul>\n<li><strong>End with a prompt.</strong> At the end of a post, encourage comments by asking a specific question or two, which is a better way of generating feedback than more general &#8220;Leave a comment&#8221; or &#8220;What do you think?&#8221; prompts. Your blog isn’t just a monologue &#8212; you want to open up the discussion to others.</li>\n<li><strong>Reply to comments.</strong> Your job doesn’t end when you hit publish. When readers leave comments, keep the conversation going with a thoughtful reply.</li>\n<li><strong>But don’t reply to every comment.</strong> If you receive many comments and reply to each with a generic one-liner (&#8220;Thanks!&#8221;), your comment thread won&#8217;t be interesting. Feel free to reply to first-time visitors to welcome them to your site, but in general, reply only if you have something substantial to add to the existing conversation.</li>\n<li><strong>Moderate with care.</strong> It’s best not to encourage or allow nasty and abusive comments. They intimidate new readers, derail conversations, and distract you from good blogging. It&#8217;s <em>your</em> online home &#8212; don&#8217;t be afraid to give polite warnings to visitors who aren&#8217;t appropriate.</li>\n<li><strong>Post commenting guidelines.</strong> If you find yourself doing a lot of policing, one way to be transparent about the type of comments you will and will not permit is to post simple guidelines. This can help you attract the kind of commenters you want, and deter unwanted behavior.</li>\n<li><strong>Return the visit.</strong> Developing friendships with your readers is one of the best parts of blogging. If you have loyal commenters, make sure you visit and engage on their blogs, too. If they like what you post, chances are you’ll be into their stuff as well.</li>\n</ul>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/pingomatic.wordpress.com/77/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/pingomatic.wordpress.com/77/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=blog.pingomatic.com&blog=68432&post=77&subd=pingomatic&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 19:22:39 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:11:"Cheri Lucas";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:11;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:24:"WP Android: 2.2.6 Update";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://android.wordpress.org/?p=744";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:53:"http://android.wordpress.org/2013/01/24/2-2-6-update/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1409:"<div id="attachment_748" class="wp-caption alignright"><a href="http://wpandroid.files.wordpress.com/2013/01/2-2-6.png"><img class="size-medium wp-image-748 " alt="Holo in Version 2.2.6" src="http://wpandroid.files.wordpress.com/2013/01/2-2-6.png?w=180&h=300" width="180" height="300" /></a><p class="wp-caption-text">UI Improvements in Version 2.2.6</p></div>\n<p>The 2.2.6 update of WordPress for Android is now available on <a href="https://play.google.com/store/apps/details?id=org.wordpress.android">Google Play</a>.</p>\n<h4>Changes in this release</h4>\n<ul>\n<li>Small UI Improvements</li>\n<li>Improved support for connecting over HTTPS.</li>\n<li>Crash fixes for <a href="http://android.trac.wordpress.org/ticket/394">#394</a> and <a href="http://android.trac.wordpress.org/ticket/395">#395</a>.</li>\n<li>Code cleanup and optimization &#8211; app size is smaller.</li>\n</ul>\n<h4>Get involved</h4>\n<p>Did you know that WordPress for Android is an open source project? If you would like to get involved please visit <a href="http://make.wordpress.org/mobile">make.wordpress.org/mobile</a>.</p>\n<p>What would you like to see improved in the app? Follow us at <a href="http://twitter.com/wpandroid">@WPAndroid</a> to get in touch!</p>\n<br />  <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=android.wordpress.org&blog=9426921&post=744&subd=wpandroid&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 19:17:42 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:11:"Cheri Lucas";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:12;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:35:"Alex King: Envato vs. Mac App Store";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://alexking.org/?p=15762";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:59:"http://alexking.org/blog/2013/01/24/envato-vs-mac-app-store";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1864:"<p><a href="https://alexking.org/blog/2013/01/22/15733">Tuesday&#8217;s discussion</a> got me thinking about the differences between Envato&#8217;s marketplace and Apple&#8217;s Mac App Store.</p>\n<p>\n\n.mac-app-store-vs-envato {\n    max-width: 550px;\n    width: 100%;\n}\n.mac-app-store-vs-envato th {\n    border-bottom: 1px solid #999;\n    padding: 5px;\n}\n.mac-app-store-vs-envato tbody td {\n    border: 1px solid #eee;\n    border-left: 0;\n    border-top: 0;\n    padding: 5px;\n    text-align: center;\n    vertical-align: middle;\n}\n.mac-app-store-vs-envato tbody tr:nth-child(odd) td {\n    background-color: #f8f8f8;\n}\n.mac-app-store-vs-envato tbody td:first-child {\n    text-align: left;\n}\n\n</p>\n<table class="mac-app-store-vs-envato" valign="middle">\n<thead>\n<tr>\n<th>&nbsp;</th>\n<th width="30%">Mac App Store</th>\n<th width="30%">Envato</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Developer&#8217;s revenue share</td>\n<td>70%</td>\n<td>33% (or 50-70%<br />if &#8220;exclusive&#8221;)</td>\n</tr>\n<tr>\n<td>Also sell your products on your website or other marketplaces?</td>\n<td>Yes</td>\n<td>Yes @ 33%,<br />No @ 50-70%</td>\n</tr>\n<tr>\n<td>Who chooses your software&#8217;s license</td>\n<td>Developer</td>\n<td>Envato</td>\n</tr>\n<tr>\n<td>Who sets the price of your software?</td>\n<td>Developer</td>\n<td>Envato</td>\n</tr>\n</tbody>\n</table>\n<p>The more I think about it, the more insane I think it is to choose to do business with Envato given their current terms.</p>\n<p>In order to put your products in their marketplace with a semi-reasonable revenue share you are choosing to completely subjugate your business to their whims. You can&#8217;t experiment with your product pricing, you can&#8217;t try other marketplaces, you can&#8217;t sell direct to your customers&#8230; you can&#8217;t even choose your own software license!</p>\n<p>People actually sign up for this?</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 18:39:59 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Alex";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:13;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:55:"bbPress: bbPress 2.2.4 Maintenance and Security Release";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://bbpress.org/?p=125495";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:79:"http://bbpress.org/blog/2013/01/bbpress-2-2-4-maintenance-and-security-release/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:652:"<p><a href="http://wordpress.org/extend/plugins/bbpress/">bbPress 2.2.4</a> (now available for download) is a maintenance and security release, and a safe and easy update for all previous bbPress 2.x versions.</p>\n<p>Version <a href="http://wordpress.org/extend/plugins/bbpress/">2.2.4</a> includes some security hardening inside the Forum Importer/Converter tool, and improves post form output sanitization. These issues were responsibly disclosed by Maty Siman.</p>\n<p><a href="http://wordpress.org/extend/plugins/bbpress/"><strong>Download 2.2.4</strong></a><strong> now or visit Dashboard → Updates in your site admin to update now.</strong></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 18:33:20 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"John James Jacoby";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:14;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:30:"Matt: Simplenote and Simperium";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=42109";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:46:"http://ma.tt/2013/01/simplenote-and-simperium/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1211:"<p><img class="alignright size-thumbnail wp-image-42112" alt="simplenote-devices" src="http://i1.wp.com/s.ma.tt/files/2013/01/simplenote-devices.png?resize=195%2C85" />As <a href="http://allthingsd.com/20130124/automattic-buys-simpermium-maker-of-simplenote/">Liz Gannes wrote in AllThingsD</a>, Automattic has acquired Simplenote, the coolest notes service around which you can get <a href="https://itunes.apple.com/app/simplenote/id289429962">on the iTunes app store</a> or for <a href="http://simplenote.com/downloads/">a variety of other platforms</a>, and Simperium, which if you&#8217;re a developer you should <a href="http://simperium.com/">watch the video on their homepage</a> and see how the technology can make what you&#8217;re doing even cooler. You can read our official announcements <a href="http://blog.simperium.com/2013/01/24/simperium-joins-automattic/">on the Simperium blog</a> and the <a href="http://simplenote.com/2013/01/24/simplenote-supercharged/">Simplenote blog, which also includes some future plans</a>. I&#8217;ve been a daily user and fan of the service for a while now, and I&#8217;m looking forward to how we can use Simperium across <a href="http://wp.com/">WP.com</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 18:11:49 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:15;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 1/24";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12571";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/9P2DYlk1_a0/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1107:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/post-from-frontend/"><strong>Post From Frontend</strong></a> allows users to create and manage posts, and edit profile info, from the frontend.</p>\n<p><a href="http://wordpress.org/extend/plugins/post-to-post-links-ii/"><strong>Post-to-Post Links II</strong></a> lets you easily create a link to another post, page, tag, or category on your site.</p>\n<p><a href="http://sudarmuthu.com/wordpress/wp-irc"><strong>WP-IRC</strong></a> provides a sidebar widget that can be used to display the number of users currently online in any IRC channel.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/liveblog/"><strong>Liveblog</strong></a> provides quick and simple blogging for following fast-paced events.</p>\n<p><a href="http://wordpress.org/extend/plugins/download-manager/"><strong>WordPress Download Manager</strong></a> helps you to manage, track and control file downloads from your WordPress site.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/9P2DYlk1_a0" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 14:00:02 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:16;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Lorelle on WP: Happy Anniversary WordPress: The Beginnings";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://lorelle.wordpress.com/?p=7830";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:83:"http://lorelle.wordpress.com/2013/01/23/happy-anniversary-wordpress-the-beginnings/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:499:"On August 16, 2005, Lorelle on WordPress became blog ID number 72 on the brand new WordPress.com. The first post was appropriately titled &#8220;Lorelle on WordPress&#8221; to introduce the site. Looking back, it&#8217;s amazing how true to form that I&#8217;ve kept the mission of this site all these years later as proposed in the first [...]<img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=lorelle.wordpress.com&blog=72&post=7830&subd=lorelle&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 24 Jan 2013 03:55:02 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:17:"Lorelle VanFossen";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:17;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:41:"Lorelle on WP: Writing for the Web Course";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:36:"http://lorelle.wordpress.com/?p=7842";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:67:"http://lorelle.wordpress.com/2013/01/23/writing-for-the-web-course/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:500:"February 18 &#8211; March 25, you will find me teaching &#8220;Writing for the Web&#8221; for Clark College Corporate and Continuing Education on Mondays from 1:30-4:30PM in the West Coast Bank Building in downtown Vancouver, Washington, just across the river from Portland, Oregon. Come join me! This