ordpress-theme-development/"><img alt="Philip Arthur Moore: Approaches to WordPress Theme Development" src="http://videos.videopress.com/4tzbrK0E/philip_arthur_moore_approaches_to_theme_development_scruberthumbnail_1.jpg" width="160" height="120" /></a></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 23 Jan 2013 23:30:12 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:16:"Chandra Maharzan";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:19;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:53:"Akismet: Sign into Akismet with WordPress.com Connect";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:30:"http://blog.akismet.com/?p=936";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:80:"http://blog.akismet.com/2013/01/23/sign-into-akismet-with-wordpress-com-connect/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3787:"<p>With the new year upon us, your friends here at <a href="http://automattic.com">Automattic</a> have resolved to make it easier to manage your accounts across all our services.</p>\n<p>Maybe you&#8217;re using <a href="http://akismet.com/">Akismet</a> to stop spam in its tracks, <a href="http://vaultpress.com/">VaultPress</a> to keep your site safe and secure, and <a href="http://polldaddy.com">Polldaddy</a> to find out what your readers are thinking. Maybe you&#8217;re using <a href="http://wordpress.com">WordPress.com</a> to build a fancy new site, or <a href="http://jetpack.me">Jetpack</a> to supercharge your self-hosted one.</p>\n<p>Now you can sign into all these awesome services, including Akismet, with just one account &#8212; your WordPress.com account!</p>\n<h2>Signing into Akismet</h2>\n<p>Starting today, you&#8217;ll be required to sign into Akismet with your WordPress.com account.</p>\n<p>The good news is, if you have an Akismet account, you already have a WordPress.com account! Simply <a href="https://akismet.com/account/">sign into Akismet</a> with the credentials you&#8217;ve been using all along.</p>\n<p><strong>Don&#8217;t have a free WordPress.com account?</strong></p>\n<p>There&#8217;s a good chance you already have one, and don&#8217;t realize it! Try <a href="https://akismet.com/account/">signing into Akismet</a> with the credentials you&#8217;ve been using all along.</p>\n<p>If you really don&#8217;t have a WordPress.com account, it only takes a few seconds to sign up and is totally free! Simply click &#8220;Sign in with WordPress.com&#8221; on the <a href="https://akismet.com/account/">Akismet account page</a>, and then click the &#8220;Need an account?&#8221; link.</p>\n<p><img class="alignnone size-medium wp-image-942" alt="signin1" src="http://akismet.files.wordpress.com/2013/01/signin1.jpeg?w=600&h=348" width="600" height="348" /></p>\n<p><strong>Already have a WordPress.com account?</strong></p>\n<p><strong></strong>You&#8217;re all set! Go ahead and <a href="http://akismet.com/account/">sign into Akismet</a> with your fancy WordPress.com account. You might be asked to &#8220;authorize&#8221; Akismet to access your WordPress.com account.</p>\n<p><img class="alignnone size-medium wp-image-943" alt="signin2" src="http://akismet.files.wordpress.com/2013/01/signin2.jpeg?w=600&h=231" width="600" height="231" /></p>\n<p><strong>Not sure if you have a WordPress.com account?</strong></p>\n<p>No problem! If you use VaultPress, Polldaddy, Jetpack, IntenseDebate, or Gravatar, you can just sign in with the same account you use for them. Otherwise, just go ahead and try <a href="https://akismet.com/account/">signing into Akismet</a> with the credentials you&#8217;ve been using to sign into Akismet all along.</p>\n<p>If it turns out that you don&#8217;t have a WordPress.com account, you can sign up for a free account in a flash! Simply click &#8220;Sign in with WordPress.com&#8221; on the <a href="https://akismet.com/account/">Akismet account page</a>, and then click the &#8220;Need an account?&#8221; link. We&#8217;ll let you know if we find one that&#8217;s tied to your email address.</p>\n<p><strong>Have any questions?</strong></p>\n<p><a href="http://en.support.wordpress.com/wpcc-faq/">Learn more</a> about how we&#8217;re making it easier to manage all your accounts here at Automattic, or <a href="http://akismet.com/contact/">drop us a line</a>.</p>\n<br />  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/936/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/936/" /></a> <img alt="" border="0" src="http://stats.wordpress.com/b.gif?host=blog.akismet.com&blog=116920&post=936&subd=akismet&ref=&feed=1" width="1" height="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 23 Jan 2013 22:32:28 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"Chris";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:20;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:14:"Matt: In Davos";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=42107";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:30:"http://ma.tt/2013/01/in-davos/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:347:"<p>I&#8217;m attending the <a href="http://www.weforum.org/">World Economic Forum in Davos</a> for the first time, if you&#8217;ll be there I&#8217;d love to meet up and of course open to any tips you have about the event, it&#8217;s very intimidating to attend a first-timer. Also: Switzerland is beautiful! Also my first time in the country.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 23 Jan 2013 15:26:29 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:21;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:27:"Alex King: Backflip Studios";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://alexking.org/?p=15688";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:52:"http://alexking.org/blog/2013/01/22/backflip-studios";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1341:"<p><a href="http://crowdfavorite.com/portfolio/backflip-studios/"><img src="http://alexking.org/wp-content/uploads/2013/01/hero-backflip-510x161.jpg" alt="Backflip Studios" width="480" height="151" class="alignnone size-medium-img wp-image-15690" /></a></p>\n<p><a href="http://crowdfavorite.com">Crowd Favorite</a> recently helped <a href="http://www.backflipstudios.com/">Backflip Studios</a> launch a great new WordPress-powered website. Backflip makes mobile games, and they have awesome artwork. It&#8217;s always a treat to work with beautiful content.</p>\n<p>This was a pretty straight-forward WordPress CMS site. We created a custom post type for their games so they can easily manage them (and add new ones, etc.). We also integrated <a href="http://crowdfavorite.com/wordpress/carrington-build/">Carrington Build</a> so they can maintain the pages and custom layouts themselves.</p>\n<p>We had a lot of fun implementing the front-end of the site. We made the site fully responsive so that its&#8217;s easy for visitors using mobile devices to get to the appropriate app store to download. We also made the site HiDPI (Retina) friendly for mobile devices.</p>\n<p>See the <a href="http://crowdfavorite.com/portfolio/backflip-studios/">full write-up here</a>. And check out Backflip&#8217;s games &#8211; they&#8217;re fun and free!</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 22 Jan 2013 23:13:07 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Alex";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:22;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:57:"Alex King: Fullscreen Editor Preview Button for WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://alexking.org/?p=15671";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:78:"http://alexking.org/blog/2013/01/22/fullscreen-editor-preview-button-wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1479:"<p>I updated my <a href="http://alexking.org/blog/2012/07/06/wordpress-fullscreen-preview-button">fullscreen editor preview button plugin</a> for WordPress 3.5 and decided to <a href="http://wordpress.org/extend/plugins/fullscreen-preview-button/">release it as a plugin on WordPress.org</a>. Mainly, this meant writing a README (and creating a <a href="https://github.com/alexkingorg/wp-fullscreen-preview-button">proper repo for it on GitHub</a>).</p>\n<p><a href="http://wordpress.org/extend/plugins/fullscreen-preview-button/"><img src="http://alexking.org/wp-content/uploads/2013/01/fullscreen-editor-preview.png" alt="Fullscreen Editor Preview Button Screenshot" width="562" height="283" class="aligncenter size-full wp-image-15744" /></a></p>\n<p>This is a simple one-trick-pony plugin &#8211; it adds a Preview button to the fullscreen editor toolbar. Nothing more, nothing less. If you&#8217;ve been up late at night pining away for this feature, this plugin is your new best friend.</p>\n<p>Enjoy!</p>\n<p>A quick note about support: As this is a free plugin released under the GPL I am offering only &#8220;Product Support&#8221; for this plugin. That means I will do my best to fix bugs and usabiity issues. Contrast this with &#8220;User Support&#8221; which we offer for all of <a href="http://crowdfavorite.com">Crowd Favorite</a>&#8216;s commercial products. With &#8220;User Support&#8221; we do our best to troubleshoot and address each customer&#8217;s issues.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 22 Jan 2013 22:53:14 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Alex";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:23;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:60:"Alex King: Is WordPress a development platform or a product?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:48:"http://pinboard-24111a62083e192f13d6dde1323167e1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:76:"http://devin.reams.me/2013/is-wordpress-a-development-platform-or-a-product/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:421:"<p>Some good thoughts from Devin following up <a href="http://alexking.org/blog/2010/05/17/wordpress-platform-or-product">my post from a few years back</a>. I think the way I expect things to evolve is into more vertical &#8220;products&#8221; built on top of WordPress while the platform becomes more robust.</p>\n<p><a href="http://alexking.org/blog/2013/01/22/is-wordpress-a-development-platform-or-a-product">#</a></p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data