:"Alex King: Regarding the Envato/WP situation, the solution I …";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"http://alexking.org/?p=15733";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:41:"http://alexking.org/blog/2013/01/22/15733";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:155:"<div>\n<p>Regarding the Envato/WP situation, the solution I like best is to have the community create a better marketplace that respects the GPL.</p>\n</div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 22 Jan 2013 22:24:39 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Alex";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:26;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:58:"Weblog Tools Collection: WordPress Theme Releases for 1/22";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12559";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/RpImKaTvf80/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1406:"<p><a href="http://wordpress.org/extend/themes/color-palette"><img class="alignnone size-thumbnail wp-image-12560" alt="screenshot" src="http://i2.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot5.png?resize=150%2C150" /></a></p>\n<p><a href="http://wordpress.org/extend/themes/color-palette"><strong>Color Palette</strong></a> is a simple colourful theme.</p>\n<p><a href="http://emptynestthemes.com/2013/01/19/stand-tall-wordpress-website-and-blog-theme/"><img class="alignnone size-thumbnail wp-image-12563" alt="DemoBlog" src="http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/DemoBlog1.png?resize=150%2C150" /></a></p>\n<p><a href="http://emptynestthemes.com/2013/01/19/stand-tall-wordpress-website-and-blog-theme/"><strong>Stand Tall</strong></a> is a strikingly simple, minimal, high contrast theme with a bold accent of brilliant red fonts in the headings and other strategic places.</p>\n<p><a href="http://wordpress.org/extend/themes/whispy"><img class="alignnone size-thumbnail wp-image-12562" alt="screenshot-2" src="http://i0.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-23.png?resize=150%2C150" /></a></p>\n<p><a href="http://wordpress.org/extend/themes/whispy"><strong>Whispy</strong></a> is a sharp, lime-ish theme.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/RpImKaTvf80" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 22 Jan 2013 14:00:56 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:27;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:47:"Weblog Tools Collection: WordPress 3.6 Progress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12552";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/K4oiBdulFLE/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1931:"<p>Since the announcement of <a href="http://wordpress.org">WordPress</a> 3.6&#8242;s <a href="http://weblogtoolscollection.com/archives/2013/01/09/wordpress-3-6-areas-of-focus/">areas of focus</a>, there has been an incredible amount of progress in just a short amount of time.</p>\n<ul>\n<li><a href="http://make.wordpress.org/core/2013/01/16/heres-a-quick-update-on-the-3-6-menu/">Menus</a> have received a simplified UI by way of breaking elements up into two separate screens, a few extra hooks, and some accessibility tweaks.</li>\n<li><a href="http://make.wordpress.org/core/2013/01/18/post-formats-ui-update-117/">Post Formats</a> will be getting some UI tweaks around theme usage and expectations of data.</li>\n<li><a href="http://make.wordpress.org/core/2013/01/18/editorial-flow-update-118/">Editorial Flow</a> will focus on how custom statuses relate to post types, the transition between statuses, and working with existing statuses.</li>\n<li><a href="http://make.wordpress.org/core/2013/01/19/autosave-and-post-locking/">Autosave</a> will focus on how to safely lock a post and still allow user control, autosaving to the browser&#8217;s local storage, and offering better warnings for login expirations.</li>\n<li><a href="http://make.wordpress.org/core/2013/01/20/revisions-update-for-18th-jan-2013/">Revisions</a> will focus on author attribution issues and improved usability.</li>\n</ul>\n<p>If you aren&#8217;t already following along with <a href="http://make.wordpress.org/core/">the Make WordPress Core blog</a>, I highly recommend doing so now, especially if you&#8217;re a plugin or theme developer, or just someone whose livelihood relies on WordPress in general. And, if any of the above looks like fun, why not <a href="http://codex.wordpress.org/Contributing_to_WordPress">get involved</a> today?</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/K4oiBdulFLE" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 21 Jan 2013 14:00:29 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:28;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"Weblog Tools Collection: WordPress Plugin Releases for 1/20";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"http://weblogtoolscollection.com/?p=12547";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:73:"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/X7HdAS8HbqI/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1835:"<h3>New plugins</h3>\n<p><a href="http://wordpress.org/extend/plugins/exif-columns/"><strong>EXIF Columns</strong></a> adds columns to the Media Library for EXIF metadata.</p>\n<p><a href="http://wordpress.org/extend/plugins/post-meta-inspector/"><strong>Post Meta Inspector</strong></a> is a quick and easy way to see post meta associated with any given post.</p>\n<h3>Updated plugins</h3>\n<p><a href="http://ocaoimh.ie/cookies-for-comments/"><strong>Cookies for Comments</strong></a> sets a cookie on a random URL that is then checked when a comment is posted. If the cookie is missing the comment is marked as spam.</p>\n<p><a href="http://www.fastsecurecontactform.com/"><strong>Fast Secure Contact Form</strong></a> lets your visitors send you a quick e-mail message and blocks all common spammer tactics. Additionally, the plugin has a multi-form feature, optional extra fields, and an option to redirect visitors to any URL after the message is sent.</p>\n<p><a href="http://wordpress.org/extend/plugins/markdown-on-save-improved/"><strong>Markdown on Save Improved</strong></a> processes your post with Markdown unless you tell it not to.</p>\n<p><a href="http://wordpress.org/extend/plugins/rewrite-rules-inspector/"><strong>Rewrite Rules Inspector</strong></a> is a straightforward WordPress admin tool for inspecting your rewrite rules.</p>\n<p><a href="http://wordpress.org/extend/plugins/safe-report-comments/"><strong>Safe Report Comments</strong></a> gives your visitors the ability to report a comment as inappropriate.</p>\n<p><a href="http://wordpress.org/extend/plugins/watu/"><strong>Watu</strong></a> allows you to create exams with unlimited questions and answers, and define grades based on collected points.</p>\n<img src="http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/X7HdAS8HbqI" height="1" width="1" />";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 20 Jan 2013 14:00:04 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:5:"James";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:29;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:17:"Matt: Twenty-Nine";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:21:"http://ma.tt/?p=42104";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:33:"http://ma.tt/2013/01/twenty-nine/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2790:"<p>A week ago  I rang in my twenty-ninth birthday and entered that twilight zone prior to thirty. It was an exciting day, <a href="http://www.skycombatace.com/">I got to fly a plane, dogfight another</a>, and do some aerobatics like a tumble, which was pretty much the coolest thing ever. Unusually for me, I managed to stay away from my computer the entire weekend, instead spending time eating, drinking, and dancing with a few friends who were also in Las Vegas. I came back online to some very sweet birthday blogs (thank you <a href="http://lorelle.wordpress.com/2013/01/09/happy-birthday-and-anniversary-matt-mullenweg/">Lorelle</a>, <a href="http://wpengine.com/2013/01/happy-29th-birthday-matt/">Austin</a>, and <a href="http://wpdaily.co/birthday-matt-2013/">John</a>!) and of course a number of nice messages on Facebook and <a href="http://twitter.com/photomatt">Twitter</a>. All in all, extremely pleasant.</p>\n<p>I travelled more this year than I ever have before, covering 261,077 miles in 292 days away from San Francisco (79 cities, 11 countries).</p>\n<p>From the outside my life sometimes can appear crazy, and my 20s have been atypical in many ways, but one of the things I appreciate the most about this past year is that things have been getting less hectic overall. Much of this I attribute technology which I&#8217;ve finally gotten to a point where the majority of it in my life serves to allow me to spend doing things I love, like writing, designing, coding, learning, and less time on infrastructure or overhead.</p>\n<p>The most interesting thing about twenty-nine so far is I&#8217;ve been getting lots of tips from people on how to end my 20s, which usually fall under &#8220;go out with a bang&#8221; from people currently in their 20s and &#8220;don&#8217;t worry it just gets better from here&#8221; from people in their 30s.</p>\n<p>My focus this year will be on simplification and streamlining. As in many years past, I find I&#8217;m the most balanced when I take time every day to read, especially in the morning, and as an additional resolution this year I&#8217;m trying to watch a film every week recommended by friends. (So far have seen My Fair Lady, Casablanca, King Corn, and American President.)</p>\n<p>Previous years: <a href="http://ma.tt/2003/01/bday/">19</a>, <a href="http://ma.tt/2004/01/so-im-20/">20</a>, <a href="http://ma.tt/2005/01/hot-barely-legal-matt/">21</a>, <a href="http://ma.tt/2006/01/matt-22/">22</a>, <a href="http://ma.tt/2007/01/twenty-three/">23</a>, <a href="http://ma.tt/2008/01/twenty-four/">24</a>, <a href="http://ma.tt/2009/01/twenty-five/">25</a>, and <a href="http://ma.tt/2010/01/twenty-six/">26</a>, <a href="http://ma.tt/2011/01/twenty-seven/">27</a>, and <a href="http://ma.tt/2012/01/twenty-eight/">28</a>.</p>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sat, 19 Jan 2013 16:33:29 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Matt";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:30;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:55:"WPTavern: WordPress News Sites And The Bermuda Triangle";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:31:"http://www.wptavern.com/?p=6760";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:107:"http://feedproxy.google.com/~r/WordpressTavern/~3/Vc43jONhrQc/wordpress-news-sites-and-the-bermuda-triangle";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:7019:"<p>A few days ago, I had the chance to participate briefly in a <a href="https://twitter.com/wptavern/status/290965739496689665">discussion held on Twitter</a> around the topic of WordPress news centric sites seemingly disappearing off the face of the earth after a certain period of time. The question which started this conversation by Doug Stewart is as follows: &#8220;<em>A question for which I have no answer: why do all WordPress news sites seem to come with an expiration date?</em>&#8220;.</p>\n<p>When I <a href="http://weblogtoolscollection.com/archives/2007/12/19/technorati-lacks-authority/">first started writing about WordPress</a> back in 2007, there were a couple of news sites I relied on for WordPress news on a regular basis. While Weblogtoolscollection.com is still chugging along, sites such as WPHacks and WPCandy fell by the wayside a year or two after I got involved with the community. Since 2007, I&#8217;ve been able to witness multiple sites sprout up like seedlings only to die off before their first bloom. I tried to not let that happen to WPTavern and for long time readers, I think that was obvious but in the end, life became too much.</p>\n<p>In its heyday, WPTavern was filled with success and the forums were a wonderful place to be. I was hanging out on the website multiple hours of every day and night chatting it up on the forum, Twitter, and posting articles on the site. I was sitting in my room, living with my parents in their apartment for hours during the day and night, at the PC just typing away. This is the reason WPTavern was able to grow at a steady pace over the course of 2009-2011. Over the course of those two years, I tried to find a way to make the site sustainable and to help me pay the bills every month. I thoroughly enjoyed just sitting at the PC all day typing articles and sharing my thoughts on what was buzzing around the WordPress community. Unfortunately, not being able to get a paycheck every week for doing it caught up with me. I tried display advertising, some affiliate marketing, and sponsorships, but at the end of the day, I was no salesman or marketer and I probably shortchanged myself numerous times. While I was working full time at the grocery store at night, I really thought WPTavern would be my way out of that hell hole which is why I decreased the hours I worked their during the week to concentrate on really making WPTavern be my main source of income. It didn&#8217;t work and within a month or two, I was back to working my 36 hour shift at the store. What would have been ideal is for someone like the grocery store to just give me a paycheck every week for sitting on my ass and writing about WordPress. </p>\n<p>I&#8217;m glad I found a buyer for the site when I did and the price they paid me was far superior to my asking price. I have a terrible habit of selling myself short. However, if I were to start a WordPress news centric site today, this is how I&#8217;d do it.</p>\n<p>First, I would find a team of people that had some expertise in a couple of different areas such as themes, plugins and WordPress hacks. I&#8217;d also hire a guy to write about the various services Automattic offers. I&#8217;d also try and find a guy that could write about the various projects such as BuddyPress and bbPress. A kick ass WordPress news centric site would need a smart, dedicated team of people to write about all those subjects. I think they would have a hard time not ever having anything to write about. While I tried to do this with WPTavern, I simply couldn&#8217;t bring myself to ask people to work for free. I did ask for guest posts but those were rarely delivered upon. So the question you&#8217;ll need to ask yourself is <em>where do you get the funding for such a team?</em> </p>\n<p>The fact of the matter is, unless you&#8217;re some super salesman or having a big company backing you, WordPress News Centric sites don&#8217;t make squat for cash. At least that&#8217;s my experience. Nothing that would pay my $700.00 mortgage every month and give me money for food. The money that I earned for affiliates and display advertising was unpredictable which was a giant hassle on me financially. </p>\n<p>Personally, I don&#8217;t think people need WordPress news centric sites anymore. Based on my experience, if you follow the right 100 people or so on Twitter, they provide you with most of what you&#8217;ll need to know within the WordPress community. Between Twitter the mailing lists (WPMail.me) and the various RSS feeds for the <a href="http://make.wordpress.org/">WP community Make websites</a>, that&#8217;s enough to keep you in the know. However, there is one facet to all of this that I think could be explored a little deeper and that is the idea of <strong>Curation</strong>. I believe that WPTavern did a great job in curating content and publishing links to things that you needed to know about or be aware of. Considering all of the different pipes of information both official and unofficial regarding the WordPress project, there is still a need for an excellent curator or a team of curators. However, the best curation I have seen over the past year or so has been from the <a href="http://wpmail.me/">WPMail.me</a> newsletter. It&#8217;s free and they have done a great job of giving people links of information they should be aware of. I find that between Twitter and this newsletter, I&#8217;m generally in the loop of what is going on within the community. </p>\n<p>My advice to anyone wanting to start a WordPress news centric website, especially if you think it&#8217;s going to make you some money is to stop immediately. Focus your efforts on where the real cash is. Commercial plugins, themes, and services. A news centric website takes so much time and energy to maintain and keep fresh, it&#8217;s not worth it in the long run unless you have a company backing you and providing you a steady stream of cash that pays the bills and puts food on the table at the same time. Every time I thought about it, I couldn&#8217;t come up with a reason that I could use to convince someone else to pay me to sit on my ass and write about WordPress all day. The value and worth comes from writing code, not text. At least that&#8217;s my conclusion.</p>\n<div class="yarpp-related-rss">\n<p>Related posts:<ol>\n<li><a href="http://www.wptavern.com/is-it-time-to-refocus-the-dashboard-for-news" rel="bookmark" title="Is It Time To Refocus The Dashboard For News?">Is It Time To Refocus The Dashboard For News?</a></li>\n<li><a href="http://www.wptavern.com/wordpress-news-out-of-atlanta" rel="bookmark" title="WordPress News Out Of Atlanta">WordPress News Out Of Atlanta</a></li>\n<li><a href="http://www.wptavern.com/5-tips-to-create-a-great-site-about-wordpress" rel="bookmark" title="5 Tips To Create A Great Site About WordPress">5 Tips To Create A Great Site About WordPress</a></li>\n</ol></p>\n</div>\n<img src="http://feeds.feedburner.com/~r/WordpressTaver